ed=\"false\" Priority=\"71\" SemiHidden=\"false\" UnhideWhenUsed=\"false\" Name=\"Colorful Shading Accent 6\" ></w:LsdException> <w:LsdException Locked=\"false\" Priority=\"72\" SemiHidden=\"false\" UnhideWhenUsed=\"false\" Name=\"Colorful List Accent 6\" ></w:LsdException> <w:LsdException Locked=\"false\" Priority=\"73\" SemiHidden=\"false\" UnhideWhenUsed=\"false\" Name=\"Colorful Grid Accent 6\" ></w:LsdException> <w:LsdException Locked=\"false\" Priority=\"19\" SemiHidden=\"false\" UnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Subtle Emphasis\" ></w:LsdException> <w:LsdException Locked=\"false\" Priority=\"21\" SemiHidden=\"false\" UnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Intense Emphasis\" ></w:LsdException> <w:LsdException Locked=\"false\" Priority=\"31\" SemiHidden=\"false\" UnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Subtle Reference\" ></w:LsdException> <w:LsdException Locked=\"false\" Priority=\"32\" SemiHidden=\"false\" UnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Intense Reference\" ></w:LsdException> <w:LsdException Locked=\"false\" Priority=\"33\" SemiHidden=\"false\" UnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Book Title\" ></w:LsdException> <w:LsdException Locked=\"false\" Priority=\"37\" Name=\"Bibliography\" ></w:LsdException> <w:LsdException Locked=\"false\" Priority=\"39\" QFormat=\"true\" Name=\"TOC Heading\" ></w:LsdException> </w:LatentStyles> </xml><![endif]-->  <!--[if gte mso 10]> <style> /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Table Normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso-style-parent:\"\"; mso-padding-alt:0in 5.4pt 0in 5.4pt; mso-para-margin:0in; mso-para-margin-bottom:.0001pt; mso-pagination:widow-orphan; font-size:10.0pt; font-family:\"Times New Roman\";} </style> <![endif]-->    <!--StartFragment--> </p><p class=\"MsoNormal\"><span style=\"font-family:Tahoma; mso-bidi-font-family:Tahoma\">REGISTRATION &#x2013; Please enter the basic requested information, read the Terms and Privacy information, and check the box indicating your agreement to these terms. Then, &#x00a0;You will receive an email from Tagbum.com.&#x00a0; Just click on the link to confirm your registration and you will be redirected to the Site. &#x00a0;If you do not see the email in your inbox, please check your spam/junk mailbox.</span><o:p></o:p></p> <p style=\"margin: 0in 0in 0.0001pt; \"><span style=\"font-family:Tahoma; mso-bidi-font-family:Tahoma\">ABOUT YOUR PERSONAL TAG - Click on the tab &#x201c;Tags&#x201d;, then click on &#x201c;Personal. Now you can create a personal tag about yourself that will follow the tag&#x2019;s that you create for others to see.&#x00a0; Promote yourself so that others will know who you are by your tag, also, if you have a favorite YouTube video, you can embed it onto your tag and it goes where you go.</span><o:p></o:p></p> <p style=\"margin: 0in 0in 0.0001pt; \"><span style=\"font-family:Tahoma;mso-bidi-font-family:Tahoma\">&#x00a0;</span><o:p></o:p></p> <p style=\"margin: 0in 0in 0.0001pt; \"><span style=\"font-family:Tahoma;mso-bidi-font-family:Tahoma\">Tags are easy to create, pick a background from the menu we provide, or open the Store, or upload your own background from your desktop. <o:p></o:p></span></p> <p style=\"margin: 0in 0in 0.0001pt; \"><span style=\"font-family:Tahoma;mso-bidi-font-family:Tahoma\">&#x00a0;</span></p> <p style=\"margin: 0in 0in 0.0001pt; \"><span style=\"font-family:Tahoma;mso-bidi-font-family:Tahoma\">The tag ATTENTION line is the largest of the three available message lines and also contains the shortest number of characters (12). There is a line above the ATTENTION line where you can make a comment (up to 50 characters in length.)&#x00a0; And, a message line below the ATTENTION line that will accommodate up to (200) characters. Select a contrasting color for the characters used in each message line from the respective color picker and type your message.<o:p></o:p></span></p> <p style=\"margin: 0in 0in 0.0001pt; \"><span style=\"font-family:Tahoma;mso-bidi-font-family:Tahoma\">&#x00a0;</span></p> <p style=\"margin: 0in 0in 0.0001pt; \"><span style=\"font-family:Tahoma;mso-bidi-font-family:Tahoma\">As you can see from the carousel examples, your finished tag will resemble an auto license plate, with an abbreviated ATTENTION message and a couple of &#x00a0;short statements (Above and below) expressing yourself.&#x00a0;This is what it&#x2019;s all about, a chance to express yourself.</span><o:p></o:p></p> <p style=\"margin: 0in 0in 0.0001pt; \"><span style=\"font-family:Tahoma;mso-bidi-font-family:Tahoma\">&#x00a0;</span><o:p></o:p></p> <p style=\"margin: 0in 0in 0.0001pt; \"><span style=\"font-family:Tahoma;mso-bidi-font-family:Tahoma\">Don&#x2019;t forget to embed your favorite YouTube video about you or whatever you want your tag to display.&#x00a0; (Coming soon&#x2026; You will be able to upload video from your device).</span><o:p></o:p></p> <p style=\"margin: 0in 0in 0.0001pt; \"><span style=\"font-family:Tahoma;mso-bidi-font-family:Tahoma\">&#x00a0;</span><o:p></o:p></p> <p style=\"margin: 0in 0in 0.0001pt; \"><span style=\"font-family:Tahoma;mso-bidi-font-family:Tahoma\">When you have finished creating your tag, click on Preview or Publish, if you don&#x2019;t like what you see, then click on Change, and after you have made the changes, click on publish. When published you will see a pop up window that indicates tag was successfully published.</span><o:p></o:p></p> <p style=\"margin: 0in 0in 0.0001pt; \"><span style=\"font-family:Tahoma;mso-bidi-font-family:Tahoma\">&#x00a0;</span><o:p></o:p></p> <p style=\"margin: 0in 0in 0.0001pt; \"><span style=\"font-family:Tahoma;mso-bidi-font-family:Tahoma\">You may change any and all the tags anytime for any reason.&#x00a0; <o:p></o:p></span></p> <p style=\"margin: 0in 0in 0.0001pt; \"><span style=\"font-family:Tahoma;mso-bidi-font-family:Tahoma\">&#x00a0;</span></p> <p style=\"margin: 0in 0in 0.0001pt; \"><span style=\"font-family:Tahoma;mso-bidi-font-family:Tahoma\">You can have as many personal tags as you wish, one for each area of your life.&#x00a0; So we made it easy for you to keep up with several personal tags.&#x00a0; This way you do not always have to keep changing up your one tag.&#x00a0; When you have created multiple personal tags, you can choose which personal tag you want to follow the tag you create to send to others.&#x00a0;</span><o:p></o:p></p> <p style=\"margin: 0in 0in 0.0001pt; \">&#x00a0;</p> <p style=\"margin: 0in 0in 0.0001pt; \"><span style=\"font-family:Tahoma; mso-bidi-font-family:Tahoma\">&#x201c;YOUR BUSINESS CARD&#x201d; -&#x00a0;When you register with Tagbum.com, the information you provide will create &#x201c;One&#x201d; generic Tagbum Social Media Marketing business card for you.&#x00a0; This business card will follow your personal tag wherever you go. &#x00a0;&#x00a0;As with personal tags, you may also have multiple business cards.&#x00a0; </span></p> <p style=\"margin: 0in 0in 0.0001pt; \"><o:p></o:p></p> <p style=\"margin: 0in 0in 0.0001pt; \">&#x00a0;</p> <p style=\"margin: 0in 0in 0.0001pt; \"><span style=\"font-family:Tahoma;mso-bidi-font-family:Tahoma\">It is easy to create your very own custom business card with your very own logo and information about you and your company. &#x00a0;When you have multiple business entities, you can choose which card follows which personal tag you choose.&#x00a0; Remember each general tag you create and send will have a personal tag follow it.</span><o:p></o:p></p> <p style=\"margin: 0in 0in 0.0001pt; \">&#x00a0;</p> <p style=\"margin: 0in 0in 0.0001pt; \"><span style=\"font-family:Tahoma; mso-bidi-font-family:Tahoma\">CREATING GENERAL TAGS - You may create as many general tags as you wish and send to as many as you want.&#x00a0; You just click on the Pencil Icon in the menu bar and start Tagging!&#x00a0; Follow the same steps as in making your personal tag.</span><o:p></o:p></p> <p style=\"margin: 0in 0in 0.0001pt; \">&#x00a0;</p> <p style=\"margin: 0in 0in 0.0001pt; \"><span style=\"font-family:Tahoma; mso-bidi-font-family:Tahoma\">SENDING THE TAG - Click on the Mail Icon and start sending. ENJOY! It&#x2019;s fun and a relaxing way to communicate with your friends, relatives, customers, and/or associates.</span><o:p></o:p></p> <!--EndFragment--><p></p>",
