style=\"text-align:justify\"><span lang=\"EN-GB\" style=\"font-family:Tahoma\">The information is then sent back to the server each time the browser requests a page from the server.&#x00a0; This enables a web server to identify and track web browsers. <o:p></o:p></span></p> <p class=\"MsoNormal\" style=\"text-align:justify\"><span lang=\"EN-GB\" style=\"font-family:Tahoma\">There are two main kinds of cookies: session cookies and persistent cookies.&#x00a0; Session cookies are deleted from your computer when you close your browser, whereas persistent cookies remain stored on your computer until deleted, or until they reach their expiry date.<o:p></o:p></span></p> <p class=\"MsoNormal\" style=\"text-align:justify\"><b><span lang=\"EN-GB\" style=\"font-family:Tahoma\">Cookies on our website<o:p></o:p></span></b></p> <p class=\"MsoNormal\" style=\"text-align:justify\"><span lang=\"EN-GB\" style=\"font-family:Tahoma\">Tagbum uses the following cookies on this website, for the following purposes:<o:p></o:p></span></p> <p class=\"MsoNormal\" style=\"text-align:justify\"><span lang=\"EN-GB\" style=\"font-family:Tahoma\">&#x00a0;</span></p> <p class=\"MsoNormal\" style=\"margin-left:.5in;text-align:justify;text-indent:-.25in; mso-list:l0 level1 lfo1;tab-stops:list .5in left 6.0in\"><!--[if !supportLists]--><span lang=\"EN-GB\" style=\"font-size:9.0pt;font-family:Wingdings;mso-fareast-font-family: Wingdings;mso-bidi-font-family:Wingdings\">l<span style=\"font-size: 7pt; font-family: 'Times New Roman'; \">&#x00a0; </span></span><!--[endif]--><span lang=\"EN-GB\" style=\"font-family:Tahoma\">Signup<o:p></o:p></span></p> <p class=\"MsoNormal\" style=\"margin-left:.5in;text-align:justify;text-indent:-.25in; mso-list:l0 level1 lfo1;tab-stops:list .5in left 6.0in\"><!--[if !supportLists]--><span lang=\"EN-GB\" style=\"font-size:9.0pt;font-family:Wingdings;mso-fareast-font-family: Wingdings;mso-bidi-font-family:Wingdings\">l<span style=\"font-size: 7pt; font-family: 'Times New Roman'; \">&#x00a0; </span></span><!--[endif]--><span lang=\"EN-GB\" style=\"font-family:Tahoma\">Publicity<o:p></o:p></span></p> <p class=\"MsoNormal\" style=\"margin-left:.5in;text-align:justify;text-indent:-.25in; mso-list:l0 level1 lfo1;tab-stops:list .5in left 6.0in\"><!--[if !supportLists]--><span lang=\"EN-GB\" style=\"font-size:9.0pt;font-family:Wingdings;mso-fareast-font-family: Wingdings;mso-bidi-font-family:Wingdings\">l<span style=\"font-size: 7pt; font-family: 'Times New Roman'; \">&#x00a0; </span></span><!--[endif]--><span lang=\"EN-GB\" style=\"font-family:Tahoma\">Last location login<o:p></o:p></span></p> <p class=\"MsoNormal\" style=\"text-align:justify\">&#x00a0;</p> <p class=\"MsoNormal\" style=\"text-align:justify\"><b><span lang=\"EN-GB\" style=\"font-family:Tahoma\">Google cookies<o:p></o:p></span></b></p> <p class=\"MsoNormal\" style=\"text-align:justify\"><span lang=\"EN-GB\" style=\"font-family:Tahoma\">Tagbum uses Google Analytics to analyse the use of this website.&#x00a0; Google Analytics generates statistical and other information about website use by means of cookies, which are stored on users' computers.&#x00a0; The information generated relating to our website is used to create reports about the use of the website. Google will store and use this information.&#x00a0; Google's privacy policy is available at: http://www.google.com/privacypolicy.html.]<o:p></o:p></span></p> <p class=\"MsoNormal\" style=\"text-align:justify\"><span lang=\"EN-GB\" style=\"font-family:Tahoma\">Tagbum publishes our own interest-based advertisements on this website.&#x00a0; Our advertisements are tailored by us and our users to reflect your interests.&#x00a0; To determine your interests, Tagbum uses our own advertising system based on the users likes, wants and needs track your behaviour across the web using cookies. <o:p></o:p></span></p> <p class=\"MsoNormal\" style=\"text-align:justify\"><b><span lang=\"EN-GB\" style=\"font-family:Tahoma\">Refusing cookies<o:p></o:p></span></b></p> <p class=\"MsoNormal\" style=\"text-align:justify\"><span lang=\"EN-GB\" style=\"font-family:Tahoma\">Most browsers allow you to refuse to accept cookies.&#x00a0; <o:p></o:p></span></p> <p class=\"MsoNormal\" style=\"text-align:justify\"><span lang=\"EN-GB\" style=\"font-family:Tahoma\">In Internet Explorer, you can refuse all cookies by clicking &#x201c;Tools&#x201d;, &#x201c;Internet Options&#x201d;, &#x201c;Privacy&#x201d;, and selecting &#x201c;Block all cookies&#x201d; using the sliding selector.&#x00a0; <o:p></o:p></span></p> <p class=\"MsoNormal\" style=\"text-align:justify\"><span lang=\"EN-GB\" style=\"font-family:Tahoma\">In Firefox, you can adjust your cookies settings by clicking &#x201c;Tools&#x201d;, &#x201c;Options&#x201d; and &#x201c;Privacy&#x201d;.<o:p></o:p></span></p> <p class=\"MsoNormal\" style=\"text-align:justify\"><span lang=\"EN-GB\" style=\"font-family:Tahoma\">Blocking cookies will have a negative impact upon the usability of some websites.<o:p></o:p></span></p> <p class=\"MsoNormal\" style=\"text-align:justify\"><span lang=\"EN-GB\" style=\"font-family:Tahoma\">&#x00a0;</span></p> <p class=\"MsoNormal\" style=\"text-align:justify\"><b><span lang=\"EN-GB\" style=\"font-family:Tahoma\">Credit<o:p></o:p></span></b></p> <p class=\"MsoNormal\" style=\"text-align:justify\"><span lang=\"EN-GB\" style=\"font-family:Tahoma\">This document was created using a Contractology template available at <a href=\"http://www.freenetlaw.com/\">http://www.freenetlaw.com</a>.<o:p></o:p></span></p>999999",
